        <div className="header-left">
          <div className="logo">
            <Link href="/">
              <a>
                <GithubOutlined />
              </a>
            </Link>
          </div>
          <div>
            <Input.Search
              onChange={handleSearchChange}
              onSearch={handleOnSearch}
              value={search}
              placeholder="搜索仓库"
            />
          </div>
        </div>
      </Layout.Header>
      <Layout.Content>{children}</Layout.Content>
      <Layout.Footer>
        Develop by ZJJ @{' '}
        <a href="https://github.com/zhangjunjie0730" target="__blank">
          github
        </a>
      </Layout.Footer>
    </Layout>
  );
};
